import React, { Component } from 'react'
import { BrowserRouter, Link, Route, Routes } from 'react-router-dom';
import App from './App';
import Contact from './Contact';
import Datails from './datails';


export default class About extends Component {

    
 


  render() {
    return (


        <BrowserRouter>
        <Link className='margin' to="/">home</Link>
        <Link  className='margin' to={"/About"}>ccc</Link>
        <Link className='margin' to={"/Contact"}>Contact</Link>
        <Link className='margin' to={"/details"}>details</Link>
        

        <Routes>
        <Route path='/' element={<Contact/>}/>
        <Route path='/tails' element={<Datails/>}/>


        </Routes>
        
        
        
        </BrowserRouter>
        )
  }
}
